import { Button, Grid, Typography } from "@mui/material";
import { Container } from "@mui/material";
import { makeStyles } from "@mui/styles";
import React from "react";

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: "#00B0EF",
  },
  container: {
    display: "flex",
    flexDirection: "column",
    padding: 24,
  },
  rowEnd: {
    display: "flex",
    flexDirection: "row",
    justifyContent: "end",
    alignItems: "center",
  },
}));

const Footer = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Container className={classes.container}>
        <Grid container justifyContent="center">
          <Grid item sm={5} xs={12} md={5}>
            <Typography variant="body2" color={"white"} fontSize={36}>
              Everything you need to know about COVID-19 Vaccination
            </Typography>
          </Grid>
          <Grid item sm={7} xs={12} md={7}>
            <div className={classes.rowEnd}>
              <Button variant="outlined" size="large">
                Register Here
              </Button>
              <div style={{ margin: 10 }} />
              <Button
                variant="contained"
                sx={{
                  color: "#fff",
                }}
              >
                View Sites
              </Button>
            </div>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default Footer;
